    this._motor = motor;
    this._color = color;
  }

  cloneCar() {
    const clonedCar = new Car();
	  Object.getOwnPropertySymbols(this).forEach(symbol => {
            clonedCar[symbol] = this[symbol];
	  });
	  return clonedCar;
  }
}

